    Example* myExamples = ExampleInitialize();
    Solution sol;
    while (myExamples != nullptr) {
        int result = sol.largestRectangleArea(myExamples->heights);

        cout << "My Ans: " << result << ", Expected: " << myExamples->expected << endl;

        myExamples = myExamples->next;
    }
